    },

    date_start: {
        type: String,
        default: "Null"
    },

    date_finish: {
        type: String,
        default: "Null"
    },

    leader: {
        type: Schema.Types.ObjectId,
        ref: "Usuario"
    },
    
    state_project: {
        type: String,
        enum:['Active', 'Inactive'], 
        default: 'Inactive'
    },

    phase: {
        type: String,
        enum:['Initiated','In development', 'Completed'],
        default: 'Null'
    },

    progress:[
        {
          type: Schema.Types.ObjectId,
          ref: "Avance",
        },
      ],


});

export default model('Proyecto', ProyectoSchema,"Projects")

